import React, { MouseEventHandler } from 'react';

interface IButtonProps {
  name: string;
  onClick: MouseEventHandler;
}

const Button: React.FC<IButtonProps> = ({ name, onClick }) => {
  return (
    <button onClick={onClick}>
      {name}
    </button>
  );
};

export default Button
